('Aztec Bonanza', 'vs7776aztec', 'Bulgarian, Chinese, Danish, English, Finnish, French, German, Greek, Indonesian, Italian, Japanese, Korean, Malaysian, Norwegian, Polish, Portuguese, Romanian, Russian, Serbian, Spanish, Swedish, Thai, Traditional Chinese, Turkish, Vietnamese', 'All ISO 4217 currencies and all major cryptocurrencies', '96.53%\r\n95.52%\r\n94.53%', 'Overall hit frequency 1 in 3.2\r\nFree spins frequency 1 in 202\r\nMax exposure hit frequency greater than 1 in 1,000,000,000', 8, '5 x 6', '7776 ways', 30, NULL, NULL, NULL, 'Tumble Feature, Free Spins with Random modifiers.', 2916000, 'x19,440.00', '0.01', '0.30', 150, 'Belarus, Bulgaria, Colombia, Denmark, Italy, Latvia, Lithuania, MGA, Portugal, Romania, Spain, United Kingdom', 'Hit the big wins in Aztec Bonanza™, the 5×6, variable ways to win videoslot. Tumble up to mystery symbols, replacing symbols and giant reels. Hit the free spins round with random features at every spin to take advantage of 7776 ways to win!', 'Aztec Bonanza&#x2122; is a high quality, medium to high volatility game that is designed for the Western European market, directly targeting Northern Europe.\r\nIt is a game that brings forward long, rewarding sessions, spending time on the machine being its focus. The main audience covers fun players that focus less on the win and more on the in-game experience. It has a single feature that ties seamlessly with the base game, the Free Spins, that begins right from big wins. The incentive is to continue playing to reach an increasing number of tumbles. The fun aspect is reinforced by the visual and sound design, which is of the highest quality on the market, with fluid 3D animations and dynamic music.\r\nAztec Bonanza&#x2122; is likely to attract lower bet players, not VIP gamblers, as it focuses on the entertainment aspect. It is a great game for female gamers, thus making it a good game to promote on alternatives to online casinos, like Bingo, Lotto and sites that have a “social” aspect to them. Due to its visual design, it is a game that looks good on camera (e.g. streaming, YouTube) but the lower volatility reduces the chance of explosive events.\r\nThe best way to promote the game is via prize drops, as they add a new layer of win to the simple gameplay. It is best suited for acquisition campaigns, as the impressive graphics and immersive flow can drag players in.', 1573553476),
('Aztec Gems', 'vs5aztecgems', 'Bulgarian, Chinese, Danish, English, Finnish, French, German, Greek, Indonesian, Italian, Japanese, Korean, Malaysian, Norwegian, Polish, Portuguese, Romanian, Russian, Serbian, Spanish, Swedish, Thai, Traditional Chinese, Turkish, Vietnamese', 'All ISO 4217 currencies and all major cryptocurrencies', '96.52%\r\n94.52%', NULL, 5, '3 x 3', '5', 5, 'Yes', NULL, NULL, 'Stacked Symbols, Win Multiplier Reel, Free Round Bonus', 37500, 'x375.00', '0.01', '0.05', 100, 'Bahamas, Belarus, Bulgaria, Colombia, Croatia, Italy, Latvia, Lithuania, MGA, Portugal, Romania, Spain, Sweden, United Kingdom', 'Start rolling in Aztec Gems™, the 3×3, 5 lines videoslot with WIN MULTIPLIER reel! All symbols are stacked and wins are increased up to 15x by the multiplier hit on the 4th reel.', NULL, 1516626484),
('Aztec Gems Deluxe', 'vs9aztecgemsdx', 'Bulgarian, Chinese, Danish, Dutch, English, Finnish, French, German, Greek, Indonesian, Italian, Japanese, Korean, Malaysian, Norwegian, Polish, Portuguese, Romanian, Russian, Serbian, Spanish, Swedish, Thai, Traditional Chinese, Turkish, Vietnamese', 'All ISO 4217 currencies and all major cryptocurrencies', '96.50%\r\n95.50%\r\n94.50%', 'Overall  hit frequency: 1 in 8.26\r\nRe-spin feature hit frequency:	1 in 134\r\nWins over 1000x hit frequency: 1 in 68,804\r\nMax exposure hit frequency greater than 1 in 1,000,000,000', 8, '3 x 3', '9', 9, NULL, NULL, NULL, 'Respins with Money Symbols, Respins Random Multiplier', 2026760, 'x22,519.00', '0.01', '0.09', 90, 'Bulgaria, Colombia, Czech Republic, Denmark, Italy, Latvia, Lithuania, MGA, Netherlands, Portugal, Romania, Spain, Sweden, Switzerland, United Kingdom', 'Find the lost Aztec temple in Aztec Gems Deluxe™, the 3×3 videoslot that offers a Money Respin Feature with the possibility to trigger the Multiplier or the Wheel of Fortune features! Look for one of the four jackpots and take home the fabulous Aztec treasure that will make you feel like an Emperor!', 'Aztec Gems Deluxe&#x2122; is a high volatility classic 3&#215;3 videoslot with modern, gambling friendly features. As a sequel to the original Aztec Gems game, its main audience is Central and Western Europe, with high attractiveness on markets like Italy, Spain. \r\nThe gameplay is focused on the win and is very easy to understand. It’s clear from the start what you should be aiming for – the fixed jackpots that provide a direct win and the money symbols that trigger a collection round with possible multipliers and direct awards in the Wheel of fortune. This makes the game a purely gambling one, perfect for players that are looking for the adrenaline of gaming rather than a simple fun experience. \r\nThis game is best suited for a traditional casino audience, made to appeal to fans of Pragmatic Play`s style of slots. However, the simple and focused nature of the features makes it good also for lotto, bingo and sports betting sites, especially as a side game (maybe in mini mode or as a cross-sell).    \r\nThe best way to promote the game is via FRB, giving in the area of 25 FRB per player in order to maximize the chances for a money symbol collect feature to hit. Tournaments and prize drops are also an effective tool to promote it because the game invites players to long gaming sessions and high time spent at the machine. The promo tools add a new layer to the entire gaming experience. Highly recommended for acquisition and cross-promotion campaigns as it can be a starting point for players into slots.', 1587971999),
