('Wild West Gold', 'vs40wildwest', 'Bulgarian, Chinese, Danish, Dutch, English, Finnish, French, German, Greek, Indonesian, Italian, Japanese, Korean, Malaysian, Norwegian, Polish, Portuguese, Romanian, Russian, Serbian, Spanish, Swedish, Thai, Traditional Chinese, Turkish, Vietnamese', 'All ISO 4217 currencies and all major cryptocurrencies', '96.51%\r\n95.56%\r\n94.53%', 'Overall hit frequency 1 in  3.3\r\nFree game frequency 1 in 177\r\nChance to hit maximum win 1 in 354,580,078', 10, '4 x 5', '40', 20, 'Yes', NULL, 'Yes', 'Free Spins with Sticky Multiplier Wilds', 1000000, 'x10,000.00', '0.01', '0.20', 100, 'Belarus, Bulgaria, Colombia, Croatia, Czech Republic, Denmark, Germany, Greece, Italy, Latvia, Lithuania, MGA, Netherlands, Ontario, Portugal, Romania, Spain, Sweden, Switzerland, United Kingdom', 'Ride to riches in Wild West Gold, the 4×5, 40 lines videoslot. All Wilds multiply up to 5x for huge wins. Go for fortune in the Free Spins round with Sticky Wilds, where you can retrigger an unlimited amount of times!', 'Wild West Gold &#x2122;is a high volatility, Pragmatic Play style, gambling focused game. It is designed for a general audience that should appeal to the mass market.\r\nOn the surface, it looks like an updated form of the feature used in “The Dog House” with a higher perceived volatility. In fact, the game has a new profile with a more rewarding gameplay and different ways to enjoy it than the original. It is geared towards a more streamlined experience, with slightly less chances to see extremely high wins in the Free Spins, but a better average win.\r\nTwo of the original’s low points have been improved in Wild West – the ability to buy Free Spins (in available jurisdictions) takes out the grinding for hitting them and now, during the round, the feature can be retriggered without blocking actual wins – Overlay Scatter symbols can hit along with normal paying symbols. The hit rate of retrigger is high, and the event is rewarding in itself.\r\nThis makes the game good for any type of operation – from pure casino, to alternatives like Lotto, Bingo, sportsbooks. It has the potential to appeal to any type of player. The simplicity of the feature makes it a very good game to teach non-slot players to play slots and cross-promote with other forms of gaming. It is also a trustworthy experience, with no complicated rules or strings attached, again helping with the mass market appeal.\r\nDue to the nature of the Free Spins round and the presence of many multipliers, the most engaging way to promote it is making it part of tournaments using the Enhance tool, as the game can create competition between players. It is appropriate for all types of campaigns, including retention, acquisition and re-activation.', 1579880805),
('Wild West Gold Megaways', 'vswayswildwest', 'Bulgarian, Chinese, Danish, English, Finnish, French, German, Greek, Indonesian, Italian, Japanese, Korean, Malaysian, Norwegian, Polish, Portuguese, Romanian, Russian, Serbian, Spanish, Swedish, Thai, Traditional Chinese, Turkish, Vietnamese', 'All ISO 4217 currencies and all major cryptocurrencies', '96.44%\r\n95.35%\r\n94.32%', NULL, 10, '6 x 7', '117649 ways', 20, 'Yes', NULL, 'Yes', NULL, 500000, 'x5,000.00', '0.01', '0.20', 100, NULL, 'Return to the ranch, where the cowboys have upgraded their gameplay with a Megaways mechanic in this highly anticipated sequel! The base game is now home to 117,649 winning ways, wild multipliers and a double chance feature whilst sticky wilds and retriggers are the main bounty for players in the bonus game that will have you shouting “YEEHAW!”', NULL, 1643285988),
